import React from "react";
import egg from "../assests/images/mobile/image-transform.jpg"

const Body = () => {
  return(
    <div>
      <div className="egg-img">
        <img className="w-full" src={egg} alt="egg on yellow background"/>
      </div>
    </div>
  )
}
export default Body
